    false,nt"url": null,nt"notes": "This annual narrative report for Ninigret
    NWR, Salt Meadow NWR, Trustom Pond NWR, Sachuest Point NWR, and Block Island NWR
    outlines Refuge accomplishments during the 1981 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Refuge administration
    is outlined; information about personnel, youth programs, funding, safety, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    grasslands, haying, pest control, and water rights. The wildlife section of the
    report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, and marine mammals.
    The public uses of the Refuge described in this report include interpretive programs,
    fishing, outdoor recreation, and law enforcement. The equipment and facilities section
    of the report provides information about rehabilitation, major maintenance, equipment
    replacement, communication systems, and energy conservation. Cooperative programs
    and items of interest are provided at the end. Newspaper articles are attached.",nt"license_title":
